      <p className="gamedescrip"> Bring your favorite co-op partner and together step into the shoes of May and Cody. As the couple is going through a divorce, through unknown means their minds are transported into two dolls which their daughter, Rose, made to represent them.  </p>
      <p className="gameget"> Where to get: </p>
      <ul className="storelogos">
        <img src={nintendo_logo} alt="nintendo logo"/> 
        {/* <li>a</li>
